HOWL is your essential dog-walking companion.  With dog theft happening country-wide, it’s time to bite back against dog thieves.  Designed by a dog-lover and former criminal defence solicitor, HOWL is a movement intended to frustrate dog thieves at every turn.

Download now for £1.79 per user for lifetime access.  No subscription, in-app purchases, catches, or hidden fees.  Each user (including your emergency contact) will need the HOWL app for maximum benefit.

PREVENTION IS BETTER THAN FOUND

Who knows what ordeals dogs suffer when they’re stolen?  Those that are found are usually damaged, displaying changed behaviours, and sometimes physical illnesses or injuries.  That’s why we believe that Prevention Is Better Than Found.

In a nutshell, the HOWL app:
-	Securely stores your dog’s details on device only in case the worst happens (acting swiftly is vital);
-	Allows your emergency contact to monitor your location during your dog walk;
-	Sends your contact an alert if you HOWL for help during your walk;
-	Has a built-in alarm so you have a personal alarm without carrying more stuff; 
-	Secures evidence of an incident including video, geotag and what 3 words location data so that you can spread the word quickly, and assist the police investigation.

PRIVACY IS EVERYTHING

All information you input into the HOWL app stays on your phone unless and until you export it.  Even we can’t access it.   

The code you pass to your emergency contact is unique to each walk, and even if someone intercepted it, it would be nonsense to them.  Absolutely no personal data will ever leave your phone and no account is required.  Only your chosen emergency contact will be able to know your location via HOWL.

Your location is only monitored when you activate a “walk” in the app, and the monitoring ends when you end the walk.  We can’t access the details of your pack, your location information, or any video footage you might film via HOWL.

CHANGING YOUR THINKING

Thieves don’t care about prison sentences; they care about being caught.  Every criminal hopes they’ll get away with their offences. HOWL is here to change that.  Evidence is what gets thieves caught.  HOWL is here to redress the balance by empowering dog lovers with ways to stay safe.

HOWL IS A POSITIVE MOVEMENT
The HOWL app is the icing on the (dog-friendly) cake.  Underpinning the app is advice about how to become less of a target for dog thieves.  We’ll challenge your thinking about how and where you walk, suggest small changes to your habits, and empower you with knowledge that thieves wish you didn’t have.

FEATURES:

-	Create your pack in HOWL – the only limit on the number of dogs and contacts is your phone’s available memory;
-	Everything stays on the phone until you decide to share it;
-	Your emergency contact can monitor your walk in real time;
-	Helps you act quickly if a thief approaches;
-	Take back control from dog thieves in a non-confrontational way;
-	Collect direct evidence to share with the police;
-      No account or personal data used, 100% privacy.
